INSERT INTO `solutions` (`id`, `s_code`, `solution_title`, `solution_desc`, `solution_code`, `sol_status`, `solution_tags`, `created_by`, `created_on`) VALUES
(2, 'SOL-20230510160526', 'Set timeout to an API using express js', '<p>Set timeout to an API using express js<br></p>', '//Set Timeout to API\r\nvar options = { \r\n	method: \'POST\',\r\n	url: \"www.domain.com/getDetails\",\r\n	timeout: 5000,\r\n	headers: \r\n	{\r\n	\'cache-control\': \'no-cache\',\r\n	\'content-type\': \'multipart/form-data\' \r\n	},\r\n	formData: formdata\r\n	};                 \r\n	request(options,  async function (error, response, body) {\r\n	// if (error) throw new Error(error);\r\n	if(error){\r\n		return res.status(200).send(error);\r\n	}\r\n	if (req.timedout) {\r\n		const error = new Error(\'Request timed out\');\r\n		return res.status(200).send(error);\r\n    }\r\n    else{\r\n  		return res.status(200).send(response.body);\r\n    }\r\n\r\n});\r\n', 1, 'set timeout, api timeout, node api timeout, express js timeout, express api timeout, timeout, node, nodejs, express, expressjs, api, request api,api', 'venkatesh.jalla@renmovil.in', '2023-05-10 12:26:59'),
(3, 'SOL-20230510012419', 'Documentation integrate new theme to our old react applications', '<p>&nbsp; &nbsp; Use following code to migrate react theme.<br></p>', 'Copy reactjs related files as follows:\r\nStep-1: Install csv-file-validator module in frontend as follows.\r\nnpm install csv-file-validator --save\r\nStep-2: Adding Routes in index.js or App.js\r\n        import Configurations from \"./components/billing/Configurations\";\r\n        import BillingTrips from \"./components/billing/BillingTripsComponent\";\r\n      \r\nFor react > 16.6 version use follows:\r\n\r\n<Route path=\"/configurations\" element={<Configurations /\\>} />\r\n<Route path=\"/trips\" element={<BillingTrips /\\>} />\r\n        import Configurations from \"./components/billing/Configurations\";\r\n        import BillingTrips from \"./components/billing/BillingTripsComponent\";\r\n      \r\n\r\n\r\nFor react < 16.6 version use follows:\r\n\r\n<Route path={`${process.env.PUBLIC_URL}/configurations`} component={Configurations} />\r\n<Route path={`${process.env.PUBLIC_URL}/trips`} component={BillingTrips} />\r\n\r\n\r\nStep-3: Copy billing folder in your components folder\r\n\r\nImport Ag-Grid in page\r\nFor AG-Grid newer versions\r\n\r\n      import { AgGridReact } from \'ag-grid-react\'; // the AG Grid React Component\r\n      import \'ag-grid-community/styles/ag-grid.css\'; // Core grid CSS, always needed\r\n      import \'ag-grid-community/styles/ag-theme-balham.css\'; // Optional theme CSS\r\n      import \'ag-grid-enterprise\';\r\n    \r\nFor AG-Grid older versions\r\n\r\n      import { AgGridReact } from \'@ag-grid-community/react\';\r\n      import {AllModules} from \'@ag-grid-enterprise/all-modules\';\r\n      import \"@ag-grid-enterprise/all-modules/dist/styles/ag-grid.css\";\r\n      import \"@ag-grid-enterprise/all-modules/dist/styles/ag-theme-balham.css\";\r\n    \r\n\r\n\r\nCopy expressJS related files as follows:\r\nStep-1: Install request module if does not exists or installed. use following command to install\r\n npm install request --save \r\nStep-2: Adding Routes in app.js\r\n\r\napp.use(\'/billing/\', require(\'./routes/routes.billing\'));\r\n\r\n\r\nStep-3: Copy routes.billing and model.billings files in your routes folder\r\n', 1, 'react theme, migrate, migration, migrate to new theme, reactjs, react', 'venkatesh.jalla@enmovil.in', '2023-05-10 13:24:19'),
(4, 'SOL-20230515091647', 'Ag-grid Cell alphanumeric validationin reactjs', 'cell value alpha numeric validations using reactjs', 'function AlphaNumericEditor() {}\r\nAlphaNumericEditor.prototype.init = function(params) {\r\n this.eInput = document.createElement(\'input\');\r\n this.eInput.value = params.value;\r\n var that = this;\r\n this.eInput.addEventListener(\'keypress\', function(event) {\r\n var regex = new RegExp(\"^[a-zA-Z0-9 _@-]+$\");\r\n var key = String.fromCharCode(!event.charCode ? event.which : event.charCode);\r\n if (!regex.test(key)) {\r\n that.eInput.focus();\r\n return false;\r\n }\r\n });\r\n};\r\nAlphaNumericEditor.prototype.getGui = function() {\r\n return this.eInput;\r\n};\r\nAlphaNumericEditor.prototype.getValue = function() {\r\n	var regex = new RegExp(\"^[a-zA-Z0-9 _@-]+$\");\r\n	var oVal = this.eInput.value;\r\n if (!regex.test(oVal) === true) {\r\n this.eInput.focus();\r\n return \"\";\r\n }\r\n	else{\r\n	 return this.eInput.value;\r\n	}\r\n};\r\nAlphaNumericEditor.prototype.destroy = function() {};\r\nAlphaNumericEditor.prototype.isPopup = function() {\r\n return false;\r\n};', 1, 'string validation, alphanumeric, ag-grid, validations', 'venkatesh.jalla@enmovil.in', '2023-05-15 09:16:47');
